import React,{ Component , Fragment } from "react";
import { MDBBtn, MDBCol, MDBContainer, MDBRow,MDBIcon } from "mdbreact";
class Coursrlist extends Component{
    render(){
        return(
        
            <Fragment>
               <MDBContainer>
               <MDBRow >
                   <span>
           <li>{this.props.details.name}
           <MDBBtn outline rounded size="lg" color="danger" ><MDBIcon icon="times" className="mr-2" /></MDBBtn>
           </li> 

           </span>
                  </MDBRow>

                 
                
                 

               </MDBContainer>
        
          </Fragment>

     
        )
    }
};
 export default Coursrlist;
